import { useEffect, useState,} from "react";

import { retrieveAFlightById, retrieveAllFlights, retrieveFlightFromTo } from "../api/CallingApi";
// import { useNavigate } from "react-router-dom";
// import { useAuth } from "./security/AuthContext";

function FlightList(){ 

        // const authContext= useAuth()

        const [flights,setFlights] = useState([])

        const [message,setmessage] = useState(null)

        const [departurePlace, setDeparturePlace] = useState("");
        const [arrivalPlace, setArrivalPlace] = useState("");

        const[id,setid] = useState(" ")

        // const nevigate=useNavigate();

        useEffect(() => {
           flightList();
     }, []);

        function flightList(){

                retrieveAllFlights()
                .then( (response) =>
                    {
                        // console.log(response.data)
                        setFlights(response.data)
                    } 
                )
                .catch( error =>console.log(error))
           
        }

        //ById
        function searchById() {  // Removed parameter since we'll use the id from state
        // if (!id.trim()) {
        //     setmessage("Please enter a flight ID");
        //     return;
        // }

        retrieveAFlightById(id)
            .then((response) => {
                if (response.data) {
                    // Wrap single flight in array for consistent rendering
                    setFlights([response.data]);
                    setmessage(null);
                } else {
                    setFlights([]);
                    setmessage("No flight found with this ID");
                }
            })
            .catch(error => {
                console.log(error);
                setmessage("Error searching for flight");
                setFlights([]);
            });
        }

        function searchByRoute() {
        if (!departurePlace.trim() || !arrivalPlace.trim()) {
            setmessage("Please enter both departure and arrival locations");
            return;
        }

        retrieveFlightFromTo(departurePlace, arrivalPlace)
            .then((response) => {
                setFlights(response.data || []);
                setmessage(response.data?.length ? null : "No flights found for this route");
            })
            .catch(error => {
                console.error(error);
                setmessage("Error searching flights");
                setFlights([]);
            });
    }

        function HandleSearch(event){
                setid(event.target.value)
            }

            function HandleSearchDeparture(event){
                setid(event.target.value)
            }

        // function deleteStudent(id){
        //     //  console.log('delete operation' + id);

        //     DeleteStudentById(id)
        //     .then( 

        //         () => 
        //             {
        //             //display message
        //             setmessage(`The todo with id ${id} is deleted`)
        //             //update todolist
        //             refreshTodos()

        //         }
        //         )
        //     .catch( error =>console.log(error))
        // }

//    function UpdateTodo(id){
//     //  console.log('Update operation' + id);
     
//      nevigate(`/CreateNewStudent/${id}`)

//    }

//    function CreateNewStudent(){

//     // console.log('Create operation');
 
//     nevigate(`/CreateNewStudent/-1`)
//    }


    return(
        <div className="container">

           <h1>Flights Lists</h1>
           {message && <div className="alert alert-warning"> {message} </div> }

           <input type="search" placeholder="search Flight "  onChange={HandleSearchDeparture} />
           <button onClick= {DepartureFromTo(placeName,placeTo)} >Search</button>

          <input 
                type="search" 
                placeholder="Enter flight ID" 
                value={id}
                onChange={HandleSearch} 
            />
            <button onClick={() => searchById()} >Search</button>
            <button className="m-2 btn btn-success" onClick={() => flightList()} >Show All</button>
           
           <table className='table'>

                <thead>
                    <tr>
                        <td>id</td>
                        <td>departureFrom</td>
                        <td>arrivalTo</td>
                        <td>departure</td>
                        <td>returnDate</td>
                        <td>seatsAvailable</td>
                    </tr>
                </thead>

                <tbody >
                    {
                        flights.map(
                            flight => (

                                <tr key={flight.id}>

                                    <td>{flight.id}</td>
                                    <td>{flight.departureFrom}</td>
                                    <td>{flight.arrivalTo}</td>
                                    <td>{flight.departure}</td>
                                    <td>{flight.returnDate}</td>
                                    <td>{flight.seatsAvailable}</td>
                                     {/* <td><button className="alert alert-warning"  onClick={ ()=> deleteStudent(todo.id)}>Delete</button> </td>
                                    <td><button className="alert alert-success"  onClick={ ()=> UpdateTodo(todo.id)}>Update</button> </td>  */}
                               </tr>
                            )
                        )
                        
                    }
                        {/* <button className="btn btn-success m-5" onClick={CreateNewStudent}> Add new Student</button> */}
                     </tbody>
               

           </table>

        </div>
    )
}

export default FlightList
